"use strict";

var backgound_loop_seconds = 1.5,
  obs_transition_seconds = 2.25,
  jump_transition_seconds = 0.7,
  cat_run_frame_current = 1,
  cat_run_frame_max = 6,
  cat_die_count = 0,
  cat_animation_interval = 100,
  high_score = 400,//400,
  score = 0,
  current_obs,
  is_jumping = false,
  is_dead = false,
  cat_interval,
  cat_die_interval,
  cat_hit_interval,
  base64string = "",
  base64string2 = "",
  sound_object = new Audio("data:audio/mp3;base64," + base64string),
  sound_object2 = new Audio("data:audio/mp3;base64," + base64string2);

function init_game() {
  document.querySelector('.tubtime_panel').style.display = 'none';
  document.querySelector('.main_game_container').style.display = 'block';
  start_game();
}
function tubtime_panel_click() {
  init_game();
}
function hide_cat_run() {
  var i;
  for (i = 1; i < 6; i = i + 1) {
    document.querySelector('.game_cat_run_' + i).style.display = 'none';
  }
}
function hide_cat_jump() {
  document.querySelector('.game_cat_jump_1').style.display = 'none';
}
function hide_cat_die() {
  var i;
  for (i = 1; i < 10; i = i + 1) {
    document.querySelector('.game_cat_die_' + i).style.display = 'none';
  }
}
function jump_cat() {
  sound_object.play();
  is_jumping = true;
  clearInterval(cat_interval);
  hide_cat_run();
  document.querySelector('.game_cat_jump_1').style.display = 'block';
  TweenMax.fromTo('.game_cat', jump_transition_seconds,
		{top: '60%'},
		{ top: '30%', repeat: 1, yoyo: true, onComplete: jump_complete.bind(this) }
    );
}
function jump_complete() {
  is_jumping = false;
  document.querySelector('.game_cat_jump_1').style.display = 'none';
  update_run_cat();
  
  clearInterval(cat_interval);
  clearInterval(cat_hit_interval);

  cat_interval = setInterval(update_run_cat.bind(this), cat_animation_interval);
  cat_hit_interval = setInterval(check_hit.bind(this), cat_animation_interval);
}
function game_click_target_click() {
  if (is_jumping === true) {
    //console.log('already jumping');
  } else if (is_dead === true) {
    //console.log('already dead');
  } else{
    jump_cat();
  }
}

function start_cat() {
  clearInterval(cat_interval);
  clearInterval(cat_hit_interval);
  
  cat_interval = setInterval(update_run_cat.bind(this), cat_animation_interval);
  cat_hit_interval = setInterval(check_hit.bind(this), cat_animation_interval);
}
function check_hit(){
 // console.log('check_hit');
  score += 1;
  document.querySelector('.game_score_score' ).innerHTML = score;
  if(current_obs !== undefined){  

  var cat = (document.querySelector('.game_cat_hit' )),
      cat_style = window.getComputedStyle(cat),
      cat_width = Number(cat_style.width.split('px')[0]),
      cat_height = Number(cat_style.height.split('px')[0]),
      cat_x = Number(cat_style.left.split('px')[0]),
      cat_y = 0,//Number(cat_style.top.split('px')[0]),
      obs_style = window.getComputedStyle(current_obs),
      obs_width = Number(obs_style.width.split('px')[0]),
      obs_height = Number(obs_style.height.split('px')[0]),
      obs_x = Number(obs_style.left.split('px')[0])+120,
      obs_y = 0,//Number(obs_style.top.split('px')[0]),
      rect1 = {x: cat_x, y: cat_y, width: cat_width, height: cat_height},
      rect2 = {x: obs_x, y: obs_y, width: (obs_width*0.75), height: obs_height},
      w = window,
      d = document,
      e = d.documentElement,
      g = d.getElementsByTagName('body')[0],
      width = w.innerWidth || e.clientWidth || g.clientWidth,  // the width
      height = w.innerHeight || e.clientHeight || g.clientHeight;  // the width

    if (cat_style.left.indexOf("%") > -1) {
      cat_x = cat_style.left.substr(0, cat_style.left.length - 1);   // get the `10`
      cat_x = parseInt(cat_x, 10);  // convert to number
      cat_x = ((cat_x * width) / 100);  // alert (percent * width / 100)
      
      obs_x = obs_style.left.substr(0, obs_style.left.length - 1);   // get the `10`
      obs_x = parseInt(obs_x, 10);  // convert to number
      obs_x = ((obs_x * width) / 100);  // alert (percent * width / 100)
    } 
    
    rect1 = {x: cat_x, y: 0, width: cat_width, height: cat_height};
    rect2 = {x: obs_x, y: 0, width: (obs_width*0.75), height: obs_height};
    
    if ((rect1.x < (rect2.x + rect2.width)) && ((rect1.x + rect1.width) > rect2.x) && (rect1.y < (rect2.y + rect2.height)) && ((rect1.height + rect1.y) > rect2.y)) {
      if(current_obs === document.querySelector(".game_table")) {
        if(is_jumping !== false){
          on_hit();
        }
      }else{
        if(is_jumping !== true) {
          on_hit();
        }
      }
    }
  }
  
  if(score > high_score){
    on_win();
  }
}
function on_win(){
  clearInterval(cat_interval);
  clearInterval(cat_hit_interval);
  
  TweenMax.killTweensOf(document.querySelector(".game_cat"));

  TweenMax.killTweensOf(current_obs);
  TweenMax.killTweensOf(document.querySelector(".main_game_wall_1"));
  TweenMax.killTweensOf(document.querySelector(".main_game_wall_2"));
  
  hide_cat_run();
  hide_cat_jump();
  
  document.querySelector('.game_win').style.display = 'block';
}
function on_hit() {
  if(is_dead === false){
    clearInterval(cat_interval);
    clearInterval(cat_hit_interval);
    
    sound_object2.play();
    
    is_dead = true;

    TweenMax.killTweensOf(document.querySelector(".game_cat"));

    TweenMax.killTweensOf(current_obs);
    TweenMax.killTweensOf(document.querySelector(".main_game_wall_1"));
    TweenMax.killTweensOf(document.querySelector(".main_game_wall_2"));

    hide_cat_run();
    hide_cat_jump();

    cat_die_count = 1;
    document.querySelector('.game_cat_die_' + cat_die_count).style.display = 'block';
    cat_die_interval = setInterval(update_die_cat, cat_animation_interval);

    TweenMax.to(document.querySelector(".game_cat"), 0.5, {left: '10%',  ease: Linear.easeNone});
  }
}
function update_die_cat() {
  cat_die_count = cat_die_count + 1;
  if(cat_die_count < 10){
      document.querySelector('.game_cat_die_' + cat_die_count).style.display = 'block';
      document.querySelector('.game_cat_die_' + (cat_die_count-1)).style.display = 'none';
  }else{
    clearInterval(cat_die_interval);
    document.querySelector('.game_lose').style.display = 'block';
  }
}
function update_run_cat() {
  document.querySelector('.game_cat_run_' + cat_run_frame_current).style.display = 'none';
  cat_run_frame_current = cat_run_frame_current + 1;
  if(cat_run_frame_current === cat_run_frame_max){
    cat_run_frame_current = 1;
  }
  document.querySelector('.game_cat_run_'+cat_run_frame_current).style.display = 'block';
}
function loop_background() {
  TweenMax.set(document.querySelector(".main_game_wall_1"),  {left: '0%', ease: Linear.easeNone});
  TweenMax.to(document.querySelector(".main_game_wall_1"), backgound_loop_seconds, {left: '-100%', ease: Linear.easeNone});
  
  TweenMax.set(document.querySelector(".main_game_wall_2"),  {left: '100%', ease: Linear.easeNone});
  TweenMax.to(document.querySelector(".main_game_wall_2"), backgound_loop_seconds, {left: '0%', ease: Linear.easeNone, onComplete:loop_background});
}
function launch_obstacle(){
  if(is_dead === false){
    var rand = Math.random();

    if(rand < (0.166*1)){
      current_obs = document.querySelector(".game_plant");
    } else if(rand < (0.166*2)){
      current_obs = document.querySelector(".game_bin");} 
    else if(rand < (0.166*3)){
      current_obs = document.querySelector(".game_box");} 
    else if(rand < (0.166*4)){
      current_obs = document.querySelector(".game_bag");
    } else if(rand < (0.166*5)){
      current_obs = document.querySelector(".game_briefcase");
    } else {
      current_obs = document.querySelector(".game_table");
    }

    TweenMax.set(current_obs,  {left: '100%', display:'block', ease: Linear.easeNone});
    TweenMax.to(current_obs, obs_transition_seconds, {left: '-50%', ease: Linear.easeNone, onComplete:launch_obstacle});
  }
}
function start_obstacles() {
  setTimeout(launch_obstacle.bind(this), 1500);
}
function start_game() {
  score = 0;
  loop_background();
  start_cat();
  start_obstacles();
}
function game_lose_click(){
  document.querySelector('.game_lose').style.display = 'none';
  document.querySelector('.game_win').style.display = 'none';
  document.querySelector('.game_goodluck').style.display = 'none';
  document.querySelector(".game_bin").style.left = '100%';
  document.querySelector(".game_box").style.left = '100%';
  document.querySelector(".game_bag").style.left = '100%';
  document.querySelector(".game_plant").style.left = '100%';
  document.querySelector(".game_briefcase").style.left = '100%';
  document.querySelector(".game_table").style.left = '100%';
  document.querySelector(".game_cat").style.top = '60%';
  document.querySelector(".game_cat").style.left = '15%';
  is_dead = false;
  is_jumping = false;
  hide_cat_die();
  start_game();
}
function game_tc_click() {
  document.querySelector('.game_tc').style.display = 'none';
}
function game_tc_btn_click() {
  document.querySelector('.game_tc').style.display = 'block';
}
function game_tick1_btn_click(){
  if(document.querySelector('.game_tick1_btn').style.opacity === '1'){
    document.querySelector('.game_tick1_btn').style.opacity = '0';
  }else{
    document.querySelector('.game_tick1_btn').style.opacity = '1';
  }
}
function game_tick2_btn_click(){
  if(document.querySelector('.game_tick2_btn').style.opacity === '1'){
    document.querySelector('.game_tick2_btn').style.opacity = '0';
  }else{
    document.querySelector('.game_tick2_btn').style.opacity = '1';
  }
}
function game_enter_btn_click(){
  var a = (document.querySelector(".game_tick1_btn").style.opacity === '1'),
    b = (document.querySelector(".game_tick2_btn").style.opacity === '1');
  
  if( a && b){
    document.querySelector(".game_form").submit();
  }
  //
  //document.querySelector('.game_goodluck').style.display = 'block';
}
var app = {
    add_listners : function () {
      document.querySelector('.tubtime_panel').addEventListener('click', tubtime_panel_click.bind(this));
      document.querySelector('.game_click_target').addEventListener('click', game_click_target_click.bind(this));
      document.querySelector('.game_lose').addEventListener('click', game_lose_click.bind(this));
      //document.querySelector('.game_goodluck').addEventListener('click', game_lose_click.bind(this));
      document.querySelector('.game_tc').addEventListener('click', game_tc_click.bind(this));
      document.querySelector('.game_tc_btn').addEventListener('click', game_tc_btn_click.bind(this));
      document.querySelector('.game_tick1_btn').addEventListener('click', game_tick1_btn_click.bind(this));
      document.querySelector('.game_tick2_btn').addEventListener('click', game_tick2_btn_click.bind(this));
      document.querySelector('.game_enter_btn').addEventListener('click', game_enter_btn_click.bind(this));
    }
  };
function init_site() {
  app.add_listners();
}
window.addEventListener("load", init_site);